description:
Showman Jerry Travers is working for producer Horace Hardwick in London.

Jerry demonstrates his new dance steps late one night in Horace's hotel,

 much to the annoyance of sleeping Dale Tremont below.

She goes upstairs to complain and the two are immediately attracted to each other. 

Complications arise when Dale mistakes Jerry for Horace.

